import React, {useState} from 'react';
import '../../style/LearnSet.css';
import WordSet from '../WordSet.js'


function LearnSet() {

    let wordSet = [
        {
            id: 1,
            part1: 'cat',
            part2: 'koshka'
        },
        {
            id: 2,
            part1: 'bog',
            part2: 'cobaka'
        }
    ]

    return (
        <div>

            <div className='create_set_btn'>
                <button className='button' >Study again</button>
            </div>
            <div className='create_set_btn'>
                <button className='button' >Got it</button>
            </div>
        </div>
    )
}

export default LearnSet;
